import "./login.css";
import logo from "./assets/lg.png";

export default function Login() {
  return (
    <div className="head-l">
      <div className="container">
        <div className="logo">
          <span>
            <img className="lib-lg" src={logo} alt="" />
          </span>
          <b className="txt-lg">eLibrary</b>
        </div>
      </div>
    </div>
  );
}
